import React from "react";
import './navigation-list.css'
import NavItem from '../navigation-item'

const NavList=()=>{
    return(
        <div>
        <NavItem label="Ноутбуки та комп'ютери"/>
        <NavItem label="Побутова технiка"/>
        <NavItem label="Сантехнiка та ремонт"/>
        <NavItem label="Одяг,взуття та прикраси"/>
        <NavItem label="Канцтовари та книги"/>
        <NavItem label="Послуги та сервiс"/>
        </div>
    )
}
export default NavList
